import axios from "axios";
import { DataGrid, GridColDef } from '@mui/x-data-grid';
import * as React from 'react';

export default function CallAPIView() {

    const columns: GridColDef[] = [
        { field: 'name', headerName: 'Nombre', width: 130 },
        { field: 'category', headerName: 'Categoria', width: 130 },
        { field: 'unity', headerName: 'Unidades', width: 130 },
        { field: 'stocked', headerName: 'En Almacen', width: 130 },
      ];

      const rows = [
        { id: 1, lastName: 'Snow', firstName: 'Jon', age: 35 },
        { id: 2, lastName: 'Lannister', firstName: 'Cersei', age: 42 },
        { id: 3, lastName: 'Lannister', firstName: 'Jaime', age: 45 },
        { id: 4, lastName: 'Stark', firstName: 'Arya', age: 16 },
        { id: 5, lastName: 'Targaryen', firstName: 'Daenerys', age: null },
        { id: 6, lastName: 'Melisandre', firstName: null, age: 150 },
        { id: 7, lastName: 'Clifford', firstName: 'Ferrara', age: 44 },
        { id: 8, lastName: 'Frances', firstName: 'Rossini', age: 36 },
        { id: 9, lastName: 'Roxie', firstName: 'Harvey', age: 65 },
      ];

    let productData;


    async function callAPIClicked() {
        let response = await axios.get("http://localhost:3001/getProducts");
        productData=response.data;
        window.alert("Productos:\n" + JSON.stringify(response.data, null, 2));
    }

    callAPIClicked();

    return (
        <div>
             <h1>{productData.Company}</h1>
        <p>{productData.Description}</p>
        </div>
    );
}
